import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src='./logo-white.png' alt="logo" />
        <h1 style={{color:"#003083"}}>
          SORRY!
        </h1>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          We Are Under Maint
        </a>
      </header>
    </div>
  );
}

export default App;
